import Head from 'next/head';
import '../styles/Home.css';

export default function Home() {
	return (
		<>
			<Head>
				<title>Transparenta</title>
			</Head>
			<main className="container mx-auto">
				<section
					className="necesidad h-screen w-full flex items-center justify-center"
					style={styles.necesidad}
				>
					<h1 className="text-xl">Una necesidad actual</h1>
				</section>
			</main>
		</>
	);
}
